import React from 'react';
// import React, { useContext, useEffect } from 'react';
// import AuthContext from '../../context/auth/authContext';
import { makeStyles } from '@material-ui/core/styles';
import CardProject from '../layout/CardProject';
import Grid from '@material-ui/core/Grid';

import H2 from '../layout/H2';

const useStyles = makeStyles((theme) => ({
    root: {
      flexGrow: 1,
    //   background image: max height 700 px
    },
    header:{
        margin: '0 0 2em 0',
        padding: 0,
        border: 0,
        verticalAlign: 'baseline',
        display: 'flex',
        flexDirection: 'column',
        justifyContent: 'space-between',
        background: '#222629 url("images/overlay.png")',
		boxShadow: 'inset -0.25em 0 0.25em 0 rgba(0, 0, 0, 0.1)',
		color: '#fff',
		height: '100%',
		left: 0,
		overflowY: 'auto',
		position: 'fixed',
		textAlign: 'right',
		top: 0,
		width: '375px',
        '&:p': {
            margin: '1em 0 0 0'
        },
        
    },
    top: {
        display: 'flex',
        flexGrow: 1,
        // background: '#222629 url("./images/overlay.png")',
        background: '#222629',
        flexDirection: 'culumn',
        justifyContent: 'space-between',
        color: '#fff',
        height: '100%',
        left: 0,
        boxShadow: 'inset -0.25em 0 0.25em 0 rgba(0, 0, 0, 0.1)',
        overflowY: 'auto',
		position: 'fixed',
		textAlign: 'right',
		top: 0,
        width: '375px',
        // backgroundColor: '#81918E',
        // backgroundImage: 'url("../../images/banner.jpg")',
        // padding: '10em 0',
		// backgroundSize: 'cover',
		// backgroundPosition: 'center center'
    },
    logo: {
        position: 'relative',
		margin: '1.75em 1.5em 1.5em 1.5em',
		minHeight: '48px',
        cursor: 'default',
        
    },
    imageLogo: {
        position: 'relative',
        margin: '0 0 0.5em 0'
    },
    row: {
        display: 'flex',
        flexWrap: 'wrap',
        boxSizing: 'border box',
        alignItems: 'stretch',

        // height: '20%',
        // display: 'block'
    },
    nav: {
        listStyle: 'none',
        paddingLeft: 0,
        marginBottom: 0,

    },
    smallheader:{
        height: '150px'
    },
    navItem: {
        paddingLeft: 0,
        display: 'block',
        padding: '0.5em 1.5em 0.5em 1.5em',
        color: 'rgba(255, 255, 255, 0.5)',
        verticalAlign: 'baseline',
        textDecoration: 'none',
        outline: 0,
        border: 0,
        transition: 'none',
        '&:a':{
            position: 'relative',
            fontSize: '0.8em',
            '&:a:before': {
                position: 'absolute',
						left: 0,
						color: '#41484c',
						textAlign: 'center',
						width: '1.25em',
						lineHeight: '1.75em'
            },
            '&:a:active': {
                background: 'rgba(0, 0, 0, 0.15)',
					boxShadow: 'inset 0 0 0.25em 0 rgba(0, 0, 0, 0.125)',
					color: '#fff'
            },
            '&:a:active span:before': {
                color: '#e27689'
            }
        }
    },
    main: {
        marginLeft: '375px',
        overflow: 'hidden',
			padding: '4em 0',
			boxShadow: 'inset 0 1px 0 0 rgba(0, 0, 0, 0.05), inset 0 0.1em 0.1em 0 rgba(0, 0, 0, 0.025)',
			textAlign: 'center',
			backgroundImage: 'url("images/overlay.png")'
    }
  }));

  const Projects = props => {
    const classes = useStyles();

const Projects = [
    {
        title:'Graphic Know-vel',
        role: 'MERN',
        date: 'Oct 19',
        main: 'Graphic Know-vels is an application to help graphic novel readers navigate, explore, annote, and save personal collections of these novels.',
        main2:'React, React-Hooks, Mongodb, Mongoose, Cheerio, Express Js, Axios, Puppeteer, Mlab, Node js, Express js, Heroku, Github, Javascript, Jquery, Bootstrap, Css, Material-ui, Cors, Prettier',
        link1:'https://shrouded-taiga-88482.herokuapp.com/',
        link1Text: 'Live Site',
        link2: 'https://github.com/moshecstern/mernbooks',
        link2Text: 'Github',
        link3: '',
        skills: [''],
        image: 'images/graphicnoveldb.png'
    },
    {
        title: 'Churchland Psychological Center',
        role: 'MERN',
        date: 'Oct 19',
        main: 'Full stack MERN website, for a healthcare center in Virginia, built with react context and role based security. Admins can add, edit, and delete information on every page. Hipaa compliant, using Hushmail.',
        main2: 'React Hooks, Context, Node, MongoDB, Express, JWT, Hushmail, and Heroku ',
        link1: 'http://www.counselinghr.com/',
        link1Text: 'Live Site',
        link2: 'https://github.com/moshecstern/churchland',
        link2Text: 'Github',
        link3: '',
        skills: [''],
        image: 'images/cpclogo2.png'
    }
]



    return (
<>
{/* <div id="header"> */}
{/* <div className={classes.header} /> */}
<div className={classes.header} />

<div className={classes.top}>

    {/* <!-- Logo --> */}
    <div className={classes.logo}>
        <span className={classes.imageLogo}><img src="images/profilepic2.JPG" alt="" /></span>
        <h1 id="title">Moshe Stern</h1>
        <p>Full Stack Computer Programmer</p>
        <p>Go To <a href="./index.html"> My Portfolio Here </a></p>

    </div>

    {/* <!-- Nav --> */}
    {/* <nav id="nav"> */}
    <div className={classes.nav}>
        <ul>
            <li className={classes.navItem}><a href='index.html'>Home</a></li>
            <li className={classes.navItem}><a href="#mongodbprojects">Mongodb</a></li>
            <li className={classes.navItem}><a href="#mysqlprojects" id="top-link">Mysql</a></li>
            <li className={classes.navItem}><a href="#firebaseprojects" id="top-link">Firebase</a></li>
            <li className={classes.navItem}><a href="#apiprojects">API Projects</a></li>
            <li className={classes.navItem}><a href="#nodeprojects" id="top-link">Node JS</a></li>
            <li className={classes.navItem}><a href="#javascriptgames">JS Games</a></li>
            <li className={classes.navItem}><a href="#skillssection">Skills</a></li>
{/* // </div> */}
</ul>
</div>

</div>
{/* // </div> */}
{/* <!-- Main --> */}

<div className={classes.main}>

{/* <!-- Intro --> */}
{/* <div className={classes.top}> */}
{/* <section id="top" className="one dark cover"> */}
    <div className="header repositoryheader">

        <div className={classes.smallheader}>
            {/* <h2 className="alt">Moshe's Project Page</h2> */}
            <H2 title={'Full Projects page'} />
        </div>


        <footer>
            <a href='./index.html' className="button icon solid fa-home">Home</a>
            {/* <!-- <a href="https://github.com/moshecstern?tab=repositories" target="_blank"
                    className="button scrolly">Github Portfolio</a> --> */}
        </footer>

    </div>
    
{/* // </section> */}
{/* <!-- Portfolio Top --> */}
<section id="portfolio" className="two">
    <div className="container">
        {/* <!-- <header>
            <h2>All My Projects</h2>
        </header> --> */}

        {/* <!-- 1st  row REACT memory game and mernbooks/ project 3 --> */}
        <div className="center" id="mongodbprojects">
            <h2>Mongodb Projects</h2>
        </div>
        {/* <!-- api calls  project1, giphy--> */}
        <Grid container className={classes.row}
        // "row projects"
         >
            {/* <!-- PROJECT 3 graphic novel website --> */}
            {Projects.filter(projects => projects.role == 'MERN' (

            <Grid item sm={12} md={6}>
            <CardProject 
                title={projects.title}
                role={projects.role}
                date={projects.date}
                main={projects.main}
                main2={projects.main2}
                link1={projects.link1}
                link1Text={projects.link1Text}
                link2={projects.link2}
                link2Text={projects.link2Text}
                link3={projects.link3}
                skills={projects.skills}
                image={projects.image}
            />
            </Grid>
            ))}
            {/* <!-- Churchland --> */}
            {/* <Grid item sm={12} md={6}>
            <CardProject 
                title={'Churchland Psychological Center'}
                role={'MERN Developer'}
                date={'Oct 19'}
                main={'Full stack MERN website, for a healthcare center in Virginia, built with react context and role based security. Admins can add, edit, and delete information on every page. Hipaa compliant, using Hushmail.'}
                main2={'React Hooks, Context, Node, MongoDB, Express, JWT, Hushmail, and Heroku '}
                link1={'http://www.counselinghr.com/'}
                link1Text={'Live Site'}
                link2={'https://github.com/moshecstern/churchland'}
                link2Text={'Github'}
                link3={''}
                skills={['']}
                image={'images/cpclogo2.png'}
            />
            </Grid> */}

        </Grid>
        {/* end row */}

        <div className="row">
            {/* <!-- readin list --> */}
            <div className="col-6 col-12-mobile">
                <article className="item">
                    <h3>Reading List</h3>
                    <a href="https://murmuring-forest-14086.herokuapp.com/" target="_blank"
                        className="image fit"><img src="images/readinglist.png" alt="" /></a>
                    <h4><a href="https://github.com/moshecstern/googleBooksReact" target="_blank">Github</a> :
                        <a href="https://murmuring-forest-14086.herokuapp.com/" target="_blank">Live Site</a>
                    </h4>
                    <header>
                        <h4>Track, add, and comment on books that you want to or have read</h4>
                        <h5>React, Mongodb, Mongoose, Mlab, Node js, Express js, Heroku, Github, Javascript,
                            Jquery, Bootstrap, Html, Css </h5>
                    </header>
                </article>
            </div>
            {/* <!-- news Clips --> */}
            <div className="col-6 col-12-mobile">
                <article className="item">
                    <h3>News Clips</h3>
                    <a href="https://aqueous-dusk-11498.herokuapp.com/" target="_blank" rel="noreferrer" className="image fit"><img
                            src="images/scraper.png" alt="" /></a>
                    <h4><a href="https://github.com/moshecstern/sports-clips" target="_blank" rel="noreferrer">Github</a> : <a
                            href="https://aqueous-dusk-11498.herokuapp.com/" target="_blank" rel="noreferrer">Live Site</a></h4>
                    <header>
                        <h4>News Clips: a website that brings you news and allows you to post messages</h4>
                        <h5>Mongodb, Mongoose, Mlab, Node js, Express js, Handlebars, Heroku, Github,
                            Javascript, Jquery, Bootstrap, Html, Css </h5>
                    </header>
                </article>
            </div>
        </div>
        {/* <!-- end of 1st row 3 projects Mongodb --> */}

        {/* <!-- MYSQL  2nd row 4 projects  liberty coffee, friend finder ,Fav Tracker ,HOT RESTURANTS,  --> */}
        <div className="center"  id="mysqlprojects">
            <h2>Mysql Projects</h2>
        </div>
        <div className="row projects">
            {/* <!-- Liberty Coffee --> */}
            <div className="col-3 col-12-mobile">
                <article className="item">
                    <h3>Liberty Coffee</h3>
                    <a href="https://young-forest-75020.herokuapp.com/" target="_blank" className="image fit"><img
                            src="images/1LBlogo.png" alt="" /></a>
                    {/* <!-- <h4>Click links</h4> --> */}
                    <h5> <a href="https://github.com/moshecstern/project2" target="_blank">Github</a> : <a
                            href="https://young-forest-75020.herokuapp.com/" target="_blank">Live Site</a></h5>
                    <header>
                        <h4>Liberty Coffee lets you find, save, and buy all diffrent types of coffee! </h4>
                        {/* <!-- <h3>Technologies</h3> --> */}
                        {/* <!-- <br> --> */}
                        <h5>Github, Heroku, JawsDB, Node.js, Express.js, MySQL, Sequelize, Passport.js, Bcrypt,
                            JavaScript, jQuery, Handlebars, Bootstrap, HTML, CSS </h5>
                    </header>
                </article>
            </div>
            {/* <!-- friend finder --> */}
            <div className="col-3 col-12-mobile">
                <article className="item">
                    <h3>Friend Finder Quiz</h3>
                    <a href="https://aqueous-reaches-76550.herokuapp.com/" target="_blank"
                        className="image fit"><img src="images/friendfinder.png" alt="" /></a>
                    <h5> <a href="https://github.com/moshecstern/friendFinder" target="_blank">Github</a> : <a
                            href="https://aqueous-reaches-76550.herokuapp.com/" target="_blank">Live
                            Site</a></h5>
                    <header>
                        <h4>Find your best match with this specially made game </h4>
                        <h4>mysql, JavaScript, jQuery, node.js, Express.js,
                            HTML, Bootstrap </h4>
                    </header>
                </article>
            </div>

            {/* <!-- Fav Tracker --> */}
            <div className="col-3 col-12-mobile">
                <article className="item">
                    <h3>Coffee Tracker</h3>
                    <a href="https://pacific-journey-55427.herokuapp.com/" target="_blank"
                        className="image fit"><img src="images/favfinder.jpg" alt="" /></a>
                    <header>
                        <h5><a href="https://github.com/moshecstern/favTracker" target="_blank">Github</a> : <a
                                href="https://pacific-journey-55427.herokuapp.com/" target="_blank">Live
                                Site</a></h5>
                        <h4>App that tracks coffees that you want and rates the ones you have!</h4>
                        <h4>MySQL,html, CSS, Javascript, Bootstrap, Node.js, Express.js, Handlebars</h4>

                    </header>
                </article>
            </div>

            {/* <!-- HOT resturants --> */}
            <div className="col-3 col-12-mobile">
                <article className="item">
